import React, { Component } from 'react';
import './App.css';
import Screen from './components/Screen';
import Wrapper from './components/Wrapper';

function App() {
  const createDigits = () => {
    const digits = [];
    for (let i = 1; i < 10; i++) {
      digits.push(
        <button key={i}>{i}</button>
      )
    }
    return digits;
  }

  return(
      <Wrapper>
        <div className='screen'>
          {Screen(45)}
        </div>
        <div>
          {createDigits()}
          <button key={0}>0</button>
        </div>
      </Wrapper>
  );
}

export default App;
